⠀
Shish tawook is a famous middle eastern dish that you will find on the menu of each and every restaurant that serves mediterranean food.The chicken is diced then marinated in yogurt and spices  and you can bake or grill it! ⠀
This post is Part of #middleeasternfoodcollab by @juveriafoodsclubs 
INGREDIENTS⠀
For the Marination ⠀
1 cup yogurt⠀
4 tbsp cup olive oil⠀
1/3 cup tomato paste⠀
1 tbsp garlic paste⠀
1 tsp ginger powder ⠀
1 teaspoon salt (or to taste)⠀
1/4 teaspoon black pepper⠀
1/2 teaspoon oregano⠀
1/4 teaspoon cinnamon⠀
2 tbsp Mayonnaise ⠀
1/2 teaspoon Chicken powder ⠀
1 tbsp lemon juice ⠀
1/2 teaspoon paprika powder ⠀
1 tbsp soya sauce ⠀
1 kg boneless chicken breast cut into large chunks⠀
2 cups cubed vegetables (optional)⠀
Skewers ⠀
INSTRUCTIONS⠀
⠀
Add all marination ingredients to a medium bowl and whisk to combine. ⠀
Add the chicken and stir well. Cover and refrigerate for a few hours. ⠀
Put the veggies and chicken on the skewers. Grill or bake until chicken is golden and no longer pink, rotating half way through (about 15 minutes per side).⠀
Sprinkle with parsley or cilantro. ⠀
Enjoy!⠀
